import { FaTools,FaReact,FaCode } from 'react-icons/fa';
import { MdDevicesOther, } from 'react-icons/md';





const ProjectComponents =({icon,title,desc,direction}) => {



    return(

        <div className='ProjectCard' style={sProject} data-aos={`fade-${direction}`} data-aos-duration="1000">
            <div className="skillIcon" style={sImage}>{(icon === 'FaReact' && <FaReact/>) || (icon === 'FaTools' && <FaTools/>) || (icon === 'MdDevicesOther' && <MdDevicesOther/>) || (icon === 'FaCode' && <FaCode/>) }</div>
            <div className="skillTitle">{title}</div>
            <div className="skillDesc">{desc}</div>
        </div>
    )
}

const sProject = {
    margin: '15px',
    width: '70%',
    height: '300px',
    borderRadius: '15px',
    padding: '30px',
    display: 'grid',
    placeItems: 'center',
    transition: 'all .6s ease-out',
    boxShadow: '1px 1px 10px 1px rgba(0,0,0,0.20)',
}
const sImage = {
    borderRadius: '50%',
    width: '80px',
    height: '80px',
    display: 'grid',
    placeItems: 'center',
    transition: 'all .3s ease',
    fontSize: '2rem',

}



export default ProjectComponents;
